INSERT INTO `scripts` VALUES ('OfferSelect','SELECT DISTINCT Programma AS \'Программа(ф)(ю)\',Bank_LK AS \'Банк,ЛК(ф)(ю)\',ref_data_marki_modeli.RefName AS \'Марки, модели(ф)(ю)\',ref_data_Kateg_TS.RefName AS \'Категория ТС(ф)(ю)\',Min_srok AS \'Мин. срок кредита(ф)(ю)\',Max_srok AS \'Макс. срок кредита(ф)(ю)\',ref_data_treb_poruchitel.RefName AS \'Требуется поручитель(ф)(ю)\',min_vozrast_zayomschika AS \'Мин. возраст заёмщика(ф)\',max_vozrast_zayomschika_M AS \'Макс. возраст заёмщика М(ф)\',max_vozrast_zayomschika_F AS \'Макс возр заемщика Ж(ф)\',ref_data_region_reistracii_zayomschika.RefName AS \'Регион регистрации заемщика(ф)(ю)\',Min_trudovoi_stazh_posl_meste AS \'Мин. трудовой стаж на посл. месте Наемный (ф)\',ref_data_New_old.RefName AS \'Новые б/у(ф)(ю)\',Max_vozrast_avto_RUS AS \'Макс возраст а/м на момент погаш.Рус(ф)(ю)\',Max_kolvo_ed AS \'Макс. кол-во ед.(ф)(ю)\',ref_data_KACKO_in_Credit.RefName AS \'Включение КАСКО в кредит(ф)\',ref_data_Strahov_zhizni.RefName AS \'Страхов_жизни(ф)\',ref_data_Kategoriya_TS.RefName AS \'Приобретаемое имущество~Категория ТС(ф)(ю)\',ref_data_Marka_model_TC.RefName AS \'Приобретаемое имущество~Марка, модель техники(ф)(ю)\',ref_data_Avans.RefName AS \'Кредитный продукт~Первоначальный взнос, аванс(ф)(ю)\',ref_data_Region_registr_zaem.RefName AS \'Общая информация~Регион регистрации заёмщика(ф)(ю)\',ref_data_KACKO_v_kredit.RefName AS \'Кредитный продукт~Включить КАСКО в сумму кредита(ф)\',ref_data_Strah_gizni_v_kredit.RefName AS \'Кредитный ипродукт~Включить страхование жизни в сумму кредита(ф)\',FIO_zaem AS \'Общая информация~ФИО заёмщика(ф)\',ref_data_Pol_zaem.RefName AS \'Общая информация~Пол заёмщика(ф)\',Data_rogdeniaya_zaem AS \'Общая информация~Дата рождения заёмщика(ф)\',Stag_na_posled_meste_zaem AS \'Общая информация~Трудовой стаж на последнем месте работы заёмщика(ф)\',Vozrast_zaem AS \'Общая информация~Возраст заёмщика(ф)\',Skolko_ed_tehniki AS \'Приобретаемое имущество~Количество единиц техники(ф)(ю)\',ref_data_Novoe_ili_bu.RefName AS \'Приобретаемое имущество~Новое ТС или Б/У(ф)(ю)\',Vozrast_TC_na_datu_pogashenia AS \'Приобретаемое имущество~Срок эксплуатации ТС на дату погашения(ф)(ю)\',Srok_kredita AS \'Кредитный продукт~Срок кредита/договора лизинга(ф)(ю)\',ref_data_Dop_zalog.RefName AS \'Общая информация~Возможность предоставления дополнительного залога(ф)(ю)\' FROM (SELECT table_CredProgr.Programma AS \'Programma\',table_CredProgr.Bank_LK AS \'Bank_LK\',multiref_CredProgr_marki_modeli.RefID AS \'marki_modeli\',multiref_CredProgr_Kateg_TS.RefID AS \'Kateg_TS\',table_CredProgr.Min_srok AS \'Min_srok\',table_CredProgr.Max_srok AS \'Max_srok\',table_CredProgr.treb_poruchitel AS \'treb_poruchitel\',table_CredProgr.min_vozrast_zayomschika AS \'min_vozrast_zayomschika\',table_CredProgr.max_vozrast_zayomschika_M AS \'max_vozrast_zayomschika_M\',table_CredProgr.max_vozrast_zayomschika_F AS \'max_vozrast_zayomschika_F\',multiref_CredProgr_region_reistracii_zayomschika.RefID AS \'region_reistracii_zayomschika\',table_CredProgr.Min_trudovoi_stazh_posl_meste AS \'Min_trudovoi_stazh_posl_meste\',multiref_CredProgr_New_old.RefID AS \'New_old\',table_CredProgr.Max_vozrast_avto_RUS AS \'Max_vozrast_avto_RUS\',table_CredProgr.Max_kolvo_ed AS \'Max_kolvo_ed\',table_CredProgr.KACKO_in_Credit AS \'KACKO_in_Credit\',table_CredProgr.Strahov_zhizni AS \'Strahov_zhizni\',table_Clients.Kategoriya_TS AS \'Kategoriya_TS\',table_Clients.Marka_model_TC AS \'Marka_model_TC\',table_Clients.Avans AS \'Avans\',table_Clients.Region_registr_zaem AS \'Region_registr_zaem\',table_Clients.KACKO_v_kredit AS \'KACKO_v_kredit\',table_Clients.Strah_gizni_v_kredit AS \'Strah_gizni_v_kredit\',table_Clients.FIO_zaem AS \'FIO_zaem\',table_Clients.Pol_zaem AS \'Pol_zaem\',table_Clients.Data_rogdeniaya_zaem AS \'Data_rogdeniaya_zaem\',table_Clients.Stag_na_posled_meste_zaem AS \'Stag_na_posled_meste_zaem\',table_Clients.Vozrast_zaem AS \'Vozrast_zaem\',table_Clients.Skolko_ed_tehniki AS \'Skolko_ed_tehniki\',table_Clie